import React from 'react'
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { white } from '@mui/material/colors';

const theme = createTheme({
  palette: {
    primary: {
        main: '#ff79c6',
    },
    secondary: {
        main: '#ff79c6',
    },
  },
});



  

export default function InputAndReturn() {
  return (
 
    <>
    <form>
    <ThemeProvider theme={theme}>
    <TextField className="input" id="filled-basic" label="Add ToDo" variant="filled" color="primary" inputProps={{
            style: {
              color: '#ff79c6', // Farbe des Texts
              '&::placeholder': {
                color: '#ff79c6', // Ändere diese Farbe nach deinen Wünschen
              },
            },
          }}/>
      <Button variant="contained">+</Button>
    </ThemeProvider>
    </form>
    </>

  )
}
